// Function to display products
function displayProducts(productsToDisplay) {
    const productContainer = document.getElementById("product-container");
    productContainer.innerHTML = ""; // Clear previous products

    productsToDisplay.forEach(product => {
        const productCard = document.createElement("div");
        productCard.className = "product-card";
        productCard.innerHTML = `
            <img src="${product.imageUrl}" alt="${product.name}" />
            <h3>${product.name}</h3>
            <p>Sustainability Score: ${product.sustainabilityScore}</p>
            <p>Eco-Friendliness: ${product.ecoFriendliness}</p>
            <p>Carbon Footprint: ${product.carbonFootprint} kg CO2</p>
            <p>Customer Reviews: ${product.customerReviews} / 5</p>
        `;
        productContainer.appendChild(productCard);
    });
}

// Function to filter products based on search input
function filterProducts() {
    const searchTerm = document.getElementById("search-bar").value.toLowerCase();
    const filteredProducts = products.filter(product => product.name.toLowerCase().includes(searchTerm));
    displayProducts(filteredProducts);
}

// Event listener for search input
document.getElementById("search-bar").addEventListener("input", filterProducts);

// Initial display of all products
displayProducts(products);
